import React from "react";

export default function Dashboard() {
  return (
    <>
      <div>
        <h1>Account Info</h1>
      </div>
      <div>
        <h3>Create Account</h3>
        <input type="text" id="owner" />
        <button>Create</button>
      </div>
      <div>
        <h3>View Account</h3>
        <p id="owner"></p>
        <button>View</button>
      </div>
    </>
  );
}
